import { SEND} from '../Actions/WinnersActions';
//import SEND from the action file

const winnersReducer = (state = [], {type, payload}) => {
    switch (type) {
      case SEND:
        return [ ...state, payload.users]
        default:
        return state;
    }  
}

export default winnersReducer;
